TRANSFORMFIELD.EXPRESSION:
DECODE(true,
isnull(Region),'UNK',

REG_MATCH(Region,'South.*'),
SUBSTR(Region,1,5)||' '||initcap(SUBSTR(Region,6,length(Region))
),
REG_MATCH(Region,'North.*'),
SUBSTR(Region,1,5)||' '||initcap(SUBSTR(Region,6,length(Region))
),
REG_MATCH(Region,'Mid.*'),
SUBSTR(Region,1,3)||' '||initcap(SUBSTR(Region,4,length(Region))
),
Region
)
